JP.calculateProductCost = function (productId, productSelections, quantityForDiscount, renewalCosts) {

  var quantity = JP.getQuantity(productId, productSelections);
  var license = productSelections['license'];
  var support = productSelections['support'];
  var vertical = JP.config.vertical || 'com';

  var isJamfNowSelection = productId === JP.PRODUCTS.JAMF_NOW.id && quantity;
  var isJamfProSelection = !isJamfNowSelection && productId && quantity && vertical && license && support;

  if (!isJamfNowSelection && !isJamfProSelection) {
    return 0;
  }

  if (isJamfNowSelection) {
    return getJamfNowProductCost(productId, quantity, vertical, license, support, quantityForDiscount, renewalCosts);
  }

  // New pricing scheme for main products
  if (JP.productUsesNewPricingModel(productId, productSelections)) {
    return getNewJamfProProductCost(productId, quantity, vertical, support, productSelections.jumpstart.active, quantityForDiscount, renewalCosts);
  }

  return getJamfProProductCost(productId, quantity, vertical, license, support, quantityForDiscount, renewalCosts);

  // Amount of discount caused by "3 first devices free"
  function getJamfNowDiscountAmount(unitCost, quantity) {
    return unitCost * Math.min(quantity, 3)
  }

  function getNewJamfProProductCost(productId, quantity, vertical, support, jumpStartSelected, quantityForDiscount, renewalCosts) {

    // Pricing format is array of 2 numbers:
    // {
    //   pricing: [ seat_cost, seat_cost_10k+ ],
    //   renewal: [ seat_cost, seat_cost_10k+ ]
    // }

    var pricing = JP.getNewProductPricingFromPriceList(productId, vertical, support);
    var perSeatCost = 0;
    var annualRenewalCost = 0;
    var perSeatRenewalCost = 0;

    // < 10,000 quantity pricing
    if (quantityForDiscount < 10000) {
      perSeatCost += Math.max((quantity * pricing.prices[0]), 0);
      perSeatRenewalCost = pricing.renewal[0];
      annualRenewalCost = quantity * perSeatRenewalCost;
    }

    // >= 10,000 quantity
    if (quantityForDiscount >= 10000) {
      perSeatCost += Math.max((quantity * pricing.prices[1]), 0);
      perSeatRenewalCost = pricing.renewal[1];
      annualRenewalCost = quantity * perSeatRenewalCost;
    }

    if (renewalCosts) {
      renewalCosts.push({
        id: productId,
        displayName: JP.PRODUCTS[productId.toUpperCase()].displayName,
        unitCost: perSeatRenewalCost,
        totalCost: annualRenewalCost
      });
    }

    return perSeatCost;
  }

  function getJamfNowProductCost(productId, quantity, vertical, license, support, quantityForDiscount, renewalCosts) {
    var productPricing = JP.getProductPricingFromPriceList(productId, support, vertical, license);
    var unitCost = JP.getUnitCost(productId, quantityForDiscount, vertical, license, support, productPricing, 0);
    var monthlyCost = quantity * unitCost;

    if (quantityForDiscount) {
      monthlyCost -= getJamfNowDiscountAmount(unitCost, quantity);
    }

    if (renewalCosts) {
      renewalCosts.push({
        id: productId,
        displayName: JP.PRODUCTS[productId.toUpperCase()].displayName,
        unitCost: unitCost,
        totalCost: (unitCost * quantity) - getJamfNowDiscountAmount(unitCost, quantity)
      });
    }

    return support === '2_year' ? monthlyCost * 24 : monthlyCost * 12;
  }

  function getJamfProProductCost(productId, quantity, vertical, license, support, quantityForDiscount, renewalCosts) {
    var discountIndex = JP.getDiscountIndexForQuantity(quantityForDiscount);
    var productPricing = JP.getProductPricingFromPriceList(productId, support, vertical, license);
    var unitCost = JP.getUnitCost(productId, quantityForDiscount, vertical, license, support, productPricing, discountIndex);

    // Renewal costs work oddly, ATM.  The renewalCosts object that's passed in gets modified, but not returned.
    // TODO: can we separate the renewalCosts workflow somehow?
    // --
    // Add annual renewal costs, representing the costs of year 2 (or year 4 for 3-year term)
    if (renewalCosts) {
      renewalCosts.push({
        id: productId,
        displayName: JP.PRODUCTS[productId.toUpperCase()].displayName,
        // SCCM does not have a per-seat cost
        unitCost: productId === JP.PRODUCTS.SCCM_PLUGIN.id ? '--' : productPricing.renewal[discountIndex],
        totalCost: productPricing.renewal[discountIndex] * quantity
      });
    }

    return quantity * unitCost;
  }
};
;

JP.calculateTotals = function (productSelections, isJamfNow) {

  var totals = {};
  var quantityForDiscount = isJamfNow ? JP.getQuantity('jamf_now', productSelections) : JP.getQuantity('macos', productSelections) + JP.getQuantity('ios', productSelections);

  // Set up buckets
  totals['software_and_support_total'] = 0;
  totals['renewals'] = [];
  totals['software_and_support_total_discounted'] = 0;

  // Fill buckets with full retail and discounted costs for main products
  _.each(_.map(JP.PRODUCTS, 'id'), function (productId) {
    totals['software_and_support_total'] += JP.calculateProductCost(productId, productSelections, 0, null);
    totals['software_and_support_total_discounted'] += JP.calculateProductCost(productId, productSelections, quantityForDiscount, totals.renewals);
  });

  // Add in premium support and services
  var premiumSupportCost = JP.getPremiumSupportCost(productSelections, totals.renewals);
  totals['software_and_support_total'] += premiumSupportCost;
  totals['software_and_support_total_discounted'] += premiumSupportCost;
  var premiumServiceCost = JP.getPremiumServiceCost(productSelections, totals.renewals);
  totals['software_and_support_total'] += premiumServiceCost;
  totals['software_and_support_total_discounted'] += premiumServiceCost;

  // Round off
  totals['software_and_support_total'] = Math.ceil(totals['software_and_support_total']);
  totals['software_and_support_total_discounted'] = Math.ceil(totals['software_and_support_total_discounted']);

  // Total up the volume discount
  totals['discount_total'] = totals['software_and_support_total_discounted'] - totals['software_and_support_total'];

  // Total up the jumpstart costs
  totals['jumpstart_total'] = JP.getJumpStartCost(productSelections);

  // Total up the training pass costs
  totals['training_pass_total'] = JP.getTrainingPassCost(productSelections);

  // Grand total
  totals['overall_total'] =
    totals['software_and_support_total']
    + totals['discount_total']
    + totals['jumpstart_total']
    + totals['training_pass_total'];

  return totals;
};
;

JP.configureNav = function () {

  var enabledViews =  _.filter(JP.config.views, 'enabled');

  if (enabledViews.length === 0){
    console.error("Error: no views were enabled in the edition config.");
  }

  // Nav is hidden by default, only show if more than one nav item configured
  if (enabledViews.length > 1){
    $('body').removeClass('hide-nav');
    // Go through all nav items, enabling those that are enabled in the config
    $('nav a[href]').each(function(i, elem){
      var $link = $(elem);
      var linkedViewName = $link.attr('href').replace('#', '');
      var viewConfig = JP.getViewConfig(linkedViewName);
      if (viewConfig.enabled){
        $link.closest('li').addClass('enabled');

        if (viewConfig.options.externalPageOverride){
          $link
            .attr('href', viewConfig.options.externalPageOverride.url)
            .attr('title', viewConfig.options.externalPageOverride.title)
            .attr('target', '_blank');
        }
      }
    });
  }

  // Set default view
  var defaultView = _.find(JP.config.views, 'default');
  JP.DEFAULT_VIEW = defaultView ? defaultView.name : 'overview';
};;

