JP.convertProductIdToDisplayName = function(productId){
  return productId
    .replace(/_/g, ' ')
    .replace(/\w\S*/g, function (txt) {
      return txt.charAt(0).toUpperCase() + txt.substr(1).toLowerCase();
    });
};;

// Formats raw number in dollars as string with active currency symbol, delimiters and exchange rate
// Adapted from http://stackoverflow.com/a/9318724
JP.formatAsActiveCurrency = function (n) {
  var
    decPlaces = n % 1 === 0 ? 0 : 2, // Show decimals if it's not a whole number
    decimalDelimiter = i18n.properties.decimalDelimiter,
    thousandsDelimiter = i18n.properties.thousandsDelimiter,
    currencySymbol = JP.useLocalCurrency ? i18n.properties.currencySymbol : "$",
    prefix = '',
    suffix = '',
    i, j;

  // Exception for intentionally blank value
  if (n === '--') {
    return n;
  }

  if (JP.useLocalCurrency) {
    n = n * JP.getExchangeRate();
  }

  if (n < 0) {
    prefix = '(';
    suffix = ')';
  }

  i = parseInt(n = Math.abs(+n || 0).toFixed(decPlaces)) + "";
  j = (j = i.length) > 3 ? j % 3 : 0;

  return prefix + currencySymbol + (j ? i.substr(0, j) + thousandsDelimiter : "") + i.substr(j).replace(/(\d{3})(?=\d)/g, "$1" + thousandsDelimiter) + (decPlaces ? decimalDelimiter + Math.abs(n - i).toFixed(decPlaces).slice(2) : "") + suffix;
};;

JP.getCurrentPriceList = function (callback) {
  var _priceList;

  function convertQuantityDiscountBreakpoints(seatsPricingLegend) {
    // from  ["1_249", "250_999", "1000_2499", "2500_4999", "5000_9999", "10000_plus"]
    // to    [250, 1000, 2500, 5000, 10000, 999999]
    var quantityDiscountBreakpoints = [];
    for (var i = 1; i < seatsPricingLegend.length; i++) {
      var split = seatsPricingLegend[i].split('_');
      quantityDiscountBreakpoints.push(split[0]);
    }
    // add a max value
    quantityDiscountBreakpoints.push(9999999);
    return quantityDiscountBreakpoints;
  }

  // Prices are cached in memory – they are refreshed on each page refresh
  function setCache(priceList) {
    _priceList = _.cloneDeep(priceList);
  }
  function getCache() {
    return _.cloneDeep(_priceList);
  }

  var savedPriceList = getCache();

  if (savedPriceList) {
    JP.currentPriceList = savedPriceList;
    callback(savedPriceList);
  } else {
    console.info('PriceList missing.  Refreshing now.');
    $.getJSON(JP.envConfig.apiUrl + 'products.json')
      .done(function (priceList) {
        JP.currentPriceList = priceList;
        JP.currentPriceList.quantityDiscountBreakpoints = convertQuantityDiscountBreakpoints(priceList.seats_pricing_legend);
        setCache(priceList);
        callback(priceList);
      })
      .fail(function (error) {
        console.error('Error fetching PriceList: ', error);
      });
    return false;
  }
};
;

JP.getDiscountIndexForQuantity = function(quantityForDiscount) {
  if (!JP.currentPriceList.quantityDiscountBreakpoints){
    console.error('Error in getDiscountIndexForQuantity. Relevant quantityDiscountBreakpoints not defined (yet).');
  } else {
    var discountIndex = 0;
     // For determining discount rate, we need to consider total quantity of iOS AND macOS products, not individual product quantities
     if (quantityForDiscount) {
       discountIndex = _.findIndex(JP.currentPriceList.quantityDiscountBreakpoints, function (discountBreakpoint) {
         return discountBreakpoint > quantityForDiscount;
       })
     }
     return discountIndex;
  }
};;

JP.getExchangeRate = function () {

  var LS_KEY = 'JP_ExchangeRates';

  function setLocalStorage(rates) {
    localStorage.setItem(LS_KEY, JSON.stringify({
      'rates': rates,
      'timestamp': new Date().getTime()
    }));
  }

  function getFromLocalStorage() {
    return JSON.parse(localStorage.getItem(LS_KEY));
  }

  // Rates considered fresh for 12 hours
  function areFresh(rates) {
    var
      now = new Date(),
      nowInMillis = now.getTime(),
      timestampInMillis = parseInt(rates['timestamp']),
      twelveHoursInMillis = 43200000;
    return timestampInMillis > nowInMillis - twelveHoursInMillis;
  }

  var savedRates = getFromLocalStorage();

  if (savedRates && areFresh(savedRates)) {
    return parseFloat(savedRates.rates[i18n.properties.currency]);
  } else {
    console.info('Exchange rate missing or out of date.  Refreshing now.');
    $.getJSON("https://openexchangerates.org/api/latest.json?app_id=9bb4a643fc9b4a84bdadd9486437e889")
        .done(function (data) {
          setLocalStorage(data.rates);
        }).fail(function(error){
          console.error('Error fetching rates: ', error);
        });
    return false;
  }
};;

